import React from "react";
import Logo from "../images/logo.png";
import { Nav, Navbar } from "react-bootstrap";
import "./style.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUserCircle, faBars, faSearch } from "@fortawesome/free-solid-svg-icons";

export default function Main() {
  return (
    <>
      <Navbar bg="light" variant="light">
        <Navbar.Brand href="home">
          <img src={Logo} width="200px"></img>
        </Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="transitionalplanning">Transitional Planning</Nav.Link>
          <Nav.Link href="alternativepaths">Alternative Paths</Nav.Link>
          <Nav.Link href="community">Community</Nav.Link>
        </Nav>
        <FontAwesomeIcon icon={faSearch} style={{"fontSize": "2em", "margin": "10px"}} color="lightGray"/>
        <FontAwesomeIcon icon={faUserCircle} style={{"fontSize": "2em", "margin": "10px"}} color="gray"/>
        <FontAwesomeIcon icon={faBars} style={{"fontSize": "2em", "margin": "10px"}} color="gray"/>
      </Navbar>
    </>
  );
}
